import './Homepage.css';
import './css/main.css';
import './css/util.css';

export class Homepage extends Component() {
    constructor(props){
        super(props);
        this.state=state;
    }

    logout(){
    	this.stop();
    	this.props.backhome();
    }

    render(){
        return (
            <div >
                <div>
                    <h1>Welcome, {name}.</h1>
                </div>
                <div className="container-login100-form-btn m-t-17">
                    <button onClick={this.logout.bind(this)} className="login100-form-btn">
                        Back!
                    </button>
                </div>
            </div>
        )
    }
}
export default Homepage;
